    "2016-05-31T01:07:05.301019",nt"name": "afsc-nmml-cetacean-line-transect-survey-in-the-gulf-of-alaska-2003",nt"isopen":
    false,nt"url": null,nt"notes": "Three marine mammal observers participated
    on a cetacean survey from 26 June to 15 July 2003, aboard the NOAA ship Miller Freeman
    as a piggyback project during a RACE acoustic-trawl survey for pollock (see RACE.s
    Midwater Assessment and Conservation Engineering report here: http://www.afsc.noaa.gov/Quarterly/jas2003/divrptsRACE2.htm).
    A total of 2,242 km of trackline were surveyed with 364 cetacean sightings (1,079
    individuals). An additional 28 cetacean sightings were made (175 individuals) during
    off effort periods. Species included harbor porpoise, Dalls porpoise, Pacific white-sided
    dolphins, killer whales, minke whales, fin whales, humpback whales, sperm whales,
    Baird.s beaked whales, and Cuviers beaked whales. See link for details:  http://www.afsc.noaa.gov/Quarterly/jas2003/divrptsNMML2.htm.",nt"license_title":
